                "code": "### Parse the timestamps \n\nGTFS data stores times in 24 hour hh:mm:ss format, but with the catch that the time can keep going after 24:00:00. This is because many routes start before midnight but finish after, and for most transit agencies the quietest period (and thus the period it makes sense to use to separate days by) occurs in the early morning.",
